          "detailled_info": "The TPA2051D3 is an audio subsystem with a mono Class-D power amplifier, a stereo DirectPath headphone amplifier, and bypass switches. The DirectPath headphone amplifier eliminates the need for external dc-blocking output capacitors. The built-in charge pump creates a negative supply voltage for the headphone amplifier, allowing a 0 V dc bias at the output. The DirectPath headphone amplifier drives 25 mW into 16 Ohms speakers from a 4.2 V supply. The subsystem includes three inputs: A differential mono input and two stereo single-ended (SE) inputs. The stereo inputs are also configurable as differential mono inputs. Each input channel has an independent volume control. Seven operating modes provide input-to-output combinations and shutdown control. Operating mode and volume levels are controlled over a 1.8 V compatible I2C interface.",
