          "vendor": "QUECTEL",
          "detailled_info": "L70, a SMD type module, brings the high performance of the MTK positioning engine to the industrial applications with compact profile, ultra low power consumption and fast positioning capability. Combining advanced AGPS called EASY(TM) (Embedded Assist System) and proven AlwaysLocate(TM) technology, L70 achieves the highest performance and fully meets the industrial standard. EASY(TM)  technology ensures L70 can calculate and predict orbits automatically using the ephemeris data (up to 3 days) stored in internal flash memory, so L70 can fix position quickly even at indoor signal levels with low power consumption. With AlwaysLocate(TM) technology, L70 can adaptively adjust the on/off time to achieve balance between positioning accuracy and power consumption according to the environmental and motion conditions. Additional feature of embedded logger function called LOCUS allows L70 to log position information to internal flash memory at default intervals of 15 seconds and provide typically more than 16 hours log capacity without adding cost.",
