          "uuid": "6e7a65d1-58ef-4236-b0ab-ac0858adb752",
          "detailled_info": "The SFH620A (DIP) and SFH6206 (SMD) feature a high current transfer ratio, low coupling capacitance and high isolation voltage. These couplers have a GaAs infrared diode emitter, which is optically coupled to a silicon planar phototransistor detector, and is incorporated in a plastic DIP-4 or SMD package. The coupling devices are designed for signal transmission between two electrically separated circuits. The couplers are end-stackable with 2.54 mm lead spacing. Creepage and clearance distances of > 8 mm are achieved with option 6. This version complies with IEC 60950 (DIN VDE 0805) for reinforced insulation to an operation voltage of 400 VRMS or DC.",
