          "vendor": "HONEYWELL",
          "detailled_info": "The Honeywell HMC5983 is a temperature compensated three-axis integrated circuit magnetometer. This surface-mount, multi-chip module is designed for low-field magnetic sensing for applications such as automotive and personal navigation, vehicle detection, and pointing. The HMC5983 includes our state-of-the-art, high-resolution HMC118x series magnetoresistive sensors plus an ASIC containing amplification, automatic degaussing strap drivers, offset cancellation, and a 12-bit ADC that enables 1deg to 2deg compass heading accuracy. The I2C or SPI serial bus allows for easy interface. The HMC5983 is a 3.0x3.0x0.9mm surface mount 16-pin leadless chip carrier (LCC).",
