          "vendor": "INVENSENSE",
          "detailled_info": "The MPU-6880 is a 6-axis MotionTracking device that combines a 3-axis gyroscope, and a 3-axis accelerometer in a small 3x3x0.9mm (24-pin QFN) package. It also features a 4096-byte FIFO that can lower the traffic on the serial bus interface, and reduce power consumption by allowing the system processor to burst read sensor data and then go into a low-power mode. With its dedicated I2C sensor bus, the MPU-6880 directly accepts inputs from external I2C devices. MPU-6880, with its 6-axis integration, enables manufacturers to eliminate the costly and complex selection, qualification, and system level integration of discrete devices, guaranteeing optimal motion performance for consumers. MPU-6880 is also designed to interface with multiple non-inertial digital sensors, such as pressure sensors, on its auxiliary I2C port.",
