          "detailled_info": "The LSM6DS3H is a system-in-package featuring a 3D digital accelerometer and a 3D digital gyroscope performing at 1.1 mA (up to 1.6 kHz ODR) in high-performance mode and enabling always-on low-power features for an optimal motion experience for the consumer. The LSM6DS3H supports main OS requirements, offering real, virtual and batch sensors with 4 kbyte FIFO + flexible 4 kbyte (FIFO or programmable) for dynamic data batching. The LSM6DS3H gyroscope supports both OIS/EIS applications. The device can be connected to the camera module through a dedicated auxiliary SPI (Mode 3) while flexibility for the primary interface is available (I2C/SPI).",
