          "vendor": "ST MICROELECTRONICS",
          "detailled_info": "The LSM9DS0 is a system-in-package featuring a 3D digital linear acceleration sensor, a 3D digital angular rate sensor, and a 3D digital magnetic sensor. The LSM9DS0 has a linear acceleration full scale of +-2g/+-4g/+-6g/+-8g/+-16g, a magnetic field full scale of +-2/+-4/+-8/+-12 gauss and an angular rate of +-245/+-500/+-2000 dps. The LSM9DS0 includes an I2C serial bus interface supporting standard and fast mode (100 kHz and 400 kHz) and an SPI serial standard interface. The system can be configured to generate interrupt signals on dedicated pins and is capable of motion and magnetic field detection. Thresholds and timing of interrupt generators are programmable by the end user. Magnetic, accelerometer and gyroscope sensing can be enabled or set in power-down mode separately for smart power management.",
