          "uuid": "0cac1e48-5989-4fd2-8ca6-35fcc8f0e8a0",
          "detailled_info": "The DS2411 silicon serial number is a low-cost, electronic registration number with external power supply. It provides an absolutely unique identity that can be determined with a minimal electronic interface (typically, a single port pin of a microcontroller). The DS2411's registration number is a factory-lasered, 64-bit ROM that includes a unique 48-bit serial number, an 8-bit CRC, and an 8-bit family code (01h). Data is transferred serially through the Maxim 1-Wire protocol. The external power supply is required, extending the operating voltage range of the device below typical 1-Wire devices.",
