          "vendor": "ON SEMICONDUCTOR",
          "detailled_info": "LC88FC2D0B is 16-bit Microcontroller with 256K-byte Flash ROM and 24K-byte RAM, 100-pin package. Main features are infrared remote controller receiver circuit (supports PPM and Manchester encoding), 16 channels of 12-bit resolution ADC, internal reset circuit, CRC circuit and etc. that are software friendly circuits and these peripheral circuit can contribute to less external components. Also, plenty of serial interface circuits (synchronous serial x 3, I2C x 3, UART x 3) can communicate with other LSIs and are suitable for home appliances and white goods which need complicated control. For software development, there is our original software development environment and with On-Chip Debugging function, it is easy to debug with user's actual application.",
