          "vendor": "ST MICROELECTRONICS",
          "detailled_info": "The STM8S005C6/K6 value line 8-bit microcontrollers offer 32 Kbytes Flash program memory, plus 128 bytes of data EEPROM. They are referred to as medium-density devices in the STM8S microcontroller family reference manual (RM0016). All devices of STM8S005C6/K6 value line provide the following benefits: performance, robustness, reduced system cost and short development cycles. Device performance and robustness are ensured by true data EEPROM supporting up to 100000 write/erase cycles, advanced core and peripherals made in a state-of-the-art technology at 16 MHz clock frequency, robust I/Os, independent watchdogs with separate clock source, and a clock security system.",
