          "detailled_info": "The STM32F098CC/RC/VC microcontrollers incorporate the high-performance ARM(R) Cortex(R)-M0 32-bit RISC core operating at up to 48 MHz frequency, high-speed embedded memories (256 Kbytes of Flash memory and 32 Kbytes of SRAM), and an extensive range of enhanced peripherals and I/Os. The device offers standard communication interfaces (two I2Cs, two SPIs/one I2S, one HDMI CEC and up to eight USARTs), one CAN, one 12-bit ADC, one 12-bit DAC with two channels, seven 16-bit timers, one 32-bit timer and an advanced-control PWM timer",
