          "vendor": "ST MICROELECTRONICS",
          "detailled_info": "The STM32F070CB/RB/C6/F6 microcontrollers incorporate the high-performance ARM(R)Cortex(R)-M0 32-bit RISC core operating at a 48 MHz frequency, high-speed embedded memories (up to 128 Kbytes of Flash memory and up to 16 Kbytes of SRAM), and an extensive range of enhanced peripherals and I/Os. All devices offer standard communication interfaces (up to two I2Cs, up to two SPIs and up to four USARTs), one USB Full speed device, one 12-bit ADC, seven general-purpose 16-bit timers and an advanced-control PWM timer.",
