          "detailled_info": "The STM32F078CB/RB/VB microcontrollers incorporate the high-performance ARM(R) Cortex(R)-M0 32-bit RISC core operating at up to 48 MHz frequency, high-speed embedded memories (128 Kbytes of Flash memory and 16 Kbytes of SRAM), and an extensive range of enhanced peripherals and I/Os. All devices offer standard communication interfaces (two I2Cs, two SPI/I2S, one HDMI CEC and four USARTs), one USB Full-speed device (crystal-less), one 12-bit ADC, one 12-bit DAC with two channels, seven 16-bit timers, one 32-bit timer and an advanced-control PWM timer.",
