          "vendor": "MAXIM INTEGRATED",
          "detailled_info": "The MAXQ618 is a low-power, 16-bit MAXQ(R) microcontroller designed for low-power applications including universal remote controls, consumer electronics, and white goods. The device combines a powerful 16-bit RISC microcontroller and integrated peripherals including two universal synchronous/asynchronous receiver-transmitters (USARTs) and an SPI master/slave communications port, along with an IR module with carrier frequency generation and flexible port I/O capable of multiplexed keypad control. The device includes 80KB of flash memory and 2KB of data SRAM. The MAXQ61C is a ROM version of this device.",
