          "detailled_info": "The M25P80 is an 8Mb (1Mb x 8) serial Flash memory device with advanced write protection mechanisms accessed by a high speed SPI-compatible bus. The device supports high-performance commands for clock frequency up to 75 MHz. The memory can be programmed 1 to 256 bytes at a time using the PAGE PROGRAM command. It is organized as 16 sectors, each containing 256 pages. Each page is 256 bytes wide. Memory can be viewed either as 4096 pages or as 1,048,576 bytes. The entire memory can be erased using the BULK ERASE command, or it can be erased one sector at a time using the SECTOR ERASE command.",
