          "vendor": "INFINEON",
          "detailled_info": "The TLS805B1 is a linear voltage regulator featuring wide input voltage range, low drop out voltage and ultra low quiescent current. With an input voltage range of 2.75 V to 42 V and ultra low quiescent of only 5 uA, the regulator is perfectly suitable for automotive or any other supply systems connected permanently to the battery. The TLS805B1SJV is the adjustable output version with an accuracy of 2 % and output current capability up to 50 mA. The new regulation concept implemented in TLS805B1 combines fast regulation and very good stability while requiring only a small ceramic capacitor of 1 uF at the output. The tracking region starts already at input voltages of 2.75 V (extended operating range). This makes the TLS805B1 also suitable to supply automotive systems that need to operate during cranking condition. Internal protection features like output current limitation and overtemperature shutdown are implemented to protect the device against immediate damage due to failures like output short circuit to GND, over-current and over-temperature. The device can be switched on and off by the Enable feature. When the device is switched off, the current consumption is typically less than 1 uA.",
