          "vendor": "INFINEON",
          "detailled_info": "The IFX54211MB-V33 is a monolithic integrated fixed linear voltage regulator for load currents up to 150 mA. The IC regulates an input voltage VIN up to 18 V to a fixed output voltage of 3.3 V with a precision of +-3%. The IFX54211MB-V33 is especially designed for applications requiring very low standby currents, e.g. with a permanent connection to a power supply, e.g. like a preregulating DCDC converter. Besides the very low quiescent current the current consumption of the device remains low also for higher load currents thanks to its PMOS powerstage. The IFX54211MB-V33 combines in an ideal way a 150 mA current capability with extremely small package outlines, low dropout capability and high Power Supply Ripple Rejection PSRR over a wide frequency range. The component can be enabled/disabled via the Enable input. The device is available in a very small surface mounted PG-SCT595 package and is designed for the harsh environment of industrial applications. Therefore it is protected against overload, short circuit and overtemperature conditions by the implemented output current limitation and the overtemperature shutdown circuit. The IFX54211MB-V33 can be also used in all other applications requiring a stabilized 3.3 V voltage.",
