          "detailled_info": "The AP7350 is a low dropout regulator with high output voltage accuracy. The AP7350 includes a voltage reference, error amplifier, current limit circuit and an enable input to turn it on/off. With the integrated resistor network, fixed output voltage versions can be delivered. With its ultra-low quiescent current and miniature package dimensions, the AP7350 is well suited for low-power handheld, wearable devices, and other battery-operated devices requiring an extended time period until new battery replacement. The AP7350 is available in the wafer level chip scale WLB0606-4 package. This part is one of the smallest LDO footprints in the industry allowing for the use of a bare minimum of board space within the application.",
