          "vendor": "TEXAS INSTRUMENTS",
          "detailled_info": "The TPS780 family of low-dropout (LDO) regulators offer the benefits of ultralow power, miniaturized packaging, and selectable dual-level output voltage levels with the Vset pin. The ultralow-power and dynamic voltage scaling (DVS) capability which provides dual-level output voltages let designers customize power consumption for specific applications. Designers can now shift to a lower voltage level in a battery-powered design when the microprocessor is in sleep mode, further reducing overall system power consumption. The two voltage levels are preset at the factory and are stored using EPROM and are available on fixed output voltage devices.",
