          "vendor": "TEXAS INSTRUMENTS",
          "detailled_info": "The LP2985-N low noise linear (LDO) regulator delivers up to 150-mA output current and only requires 300-mV dropout voltage of input to output. Using an optimized vertically integrated PNP (VIP) process, the LP2985-N delivers unequaled performance for all battery-powered designs. The LP2985-N device provides 1% tolerance precision output voltage with only 75-uA quiescent current at 1-mA load and 850 uA at 150-mA load. By adding a 10-nF bypass capacitor, the output noise can be reduced to 30 uVRMS in a 30-kHz bandwidth. The LP2985-N is designed to work with a ceramic output capacitor with equivalent series resistance (ESR) as low as 5 mOhms. The device is available with fixed output voltage from 2.5 V to 6.1 V. Contact Texas Instrument Sales for specific voltage option needs.",
