          "vendor": "TEXAS INSTRUMENTS",
          "detailled_info": "The TPS783 family of low-dropout regulators (LDOs) offers the benefits of ultralow power and miniaturized packaging. This LDO family is designed specifically for battery-powered applications where ultralow quiescent current is a critical parameter. The TPS783, with ultralow Iq (500 nA), is ideal for microprocessors, microcontrollers, and other battery-powered applications. The absence of pulldown circuitry at the output of the LDO provides the flexibility to use the regulator output capacitor as a temporary backup power supply (for example, during battery replacement). The ultralow power and miniaturized packaging allow designers to customize power consumption for specific applications. Consult with your local factory representative for exact voltage options and ordering information; minimum order quantities may apply.",
