          "vendor": "ON SEMICONDUCTOR",
          "detailled_info": "These linear low drop voltage regulators provide up to 500 mA over a user-adjustable output range of 1.25 V to 5.0 V, or at a fixed output voltage of 1.5 V, 3.3 V or 5.0 V, with typical output voltage accuracy better than 3%. An internal PNP pass transistor permits low dropout voltage and operation at full load current at the minimum input voltage. NCV versions are qualified for demanding automotive applications that require extended temperature operation and site and change control. NCP5500 and NCV5500 versions include an Enable/Shutdown function and are available in a DPAK-5 and SOIC-8 packages. NCP5501 and NCV5501 versions are available in DPAK-3 for applications that do not require logical on/off control. This regulator family is ideal for applications that require a broad input voltage range, and low dropout performance up to 500 mA load using low cost ceramic capacitors. Integral protection features include short circuit current and thermal shutdown.",
