          "vendor": "ON SEMICONDUCTOR",
          "detailled_info": "The MC33375 series are micropower low dropout voltage regulators available in a wide variety of output voltages as well as packages, SOT-223 and SOP-8. These devices feature a very low quiescent current and are capable of supplying output currents up to 300 mA. Internal current and thermal limiting protection are provided by the presence of a short circuit at the output and an internal thermal shutdown circuit. The MC33375 has a control pin that allows a logic level signal to turn-off or turn-on the regulator output. Due to the low input-to-output voltage differential and bias current specifications, these devices are ideally suited for battery powered computer, consumer, and industrial equipment where an extension of useful battery life is desirable.",
