          "vendor": "ST MICROELECTRONICS",
          "detailled_info": "The LD2985 is a 150 mA fixed output voltage regulator. The ultra low drop voltage and the low quiescent current make them particularly suitable for low noise, low power applications, and in battery powered systems. In sleep mode quiescent current is less than 1 uA when INHIBIT pin is pulled low. Shutdown logic control function is available on pin 3 (TTL compatible). This means that when the device is used as local regulator, it is possible to put a part of the board in standby, decreasing the total power consumption. An external capacitor, CBYP= 10 nF, connected between bypass pin and GND reduces the noise to 30 uVrms. Typical application are in cellular phone, palmtop laptop computer, personal digital assistant (PDA), personal stereo, camcorder and camera.",
