          "detailled_info": "The LK112S is a low-dropout linear regulator with shutdown function. The internal switch can be controlled by TTL or CMOS logic levels. The device is ON when the control pin is pulled to a high logic level. An external capacitor can be connected to the noise bypass pin to reduce the output noise level to 30 uVrms. An internal PNP pass transistor is used to achieve a low-dropout voltage. The LK112S has a very low quiescent current in ON mode while in OFF mode the Iqis reduced to 100 nA max. The internal thermal shutdown circuitry limits the junction temperature below 150degC. The load current is internally monitored and in the presence of a short-circuit or overcurrent conditions at the output, the device shuts down.",
