          "detailled_info": "The LD29300 is a high current, high accuracy, low-dropout voltage regulator series. These regulators feature 400 mV dropout voltage and very low ground current. Designed for high current loads, these devices are also used in lower current, extremely low dropout-critical systems, where their tiny dropout voltage and ground current values are important attributes. Typical applications are in power supply switching post regulation, series power supply for monitors, series power supply for VCRs and TVs, computer systems and battery powered systems.",
