          "vendor": "ST MICROELECTRONICS",
          "detailled_info": "The LD49150 is a high-bandwidth, low-dropout, 1.5 A voltage regulator, ideal for powering core voltages of low power microprocessors. The LD49150 implements a dual supply configuration, which guarantees a very low output impedance and a very fast transient response. The LD49150 requires a bias input supply and a main input supply, allowing ultra-low input voltages on the main supply rail. The input supply operates from 1.4 V to 5.5 V and the bias supply requires between 3 V and 6 V to work properly. The LD49150 offers fixed output voltages from 0.8 V to 1.8 V and adjustable output voltages starting from 0.8 V. The LD49150 requires a minimum output capacitance for stability, and works optimally with small ceramic capacitors.",
