          "vendor": "DIODES INCORPORATED",
          "detailled_info": "The AP3417C is a high efficiency step-down DC-DC voltage converter. The chip operation is optimized by peak-current mode architecture with built-in synchronous power MOSFET switchers. The oscillator and timing capacitors are all built-in providing an internal switching frequency of 1.5MHz that allows the use of small surface mount inductors and capacitors for portable product implementations. Integrated Soft Start (SS), Under Voltage Lock Out (UVLO), Thermal Shutdown Detection (TSD) and Short Circuit Protection are designed to provide reliable product applications. The device is available in adjustable output voltage version ranging from 0.6V to 0.9*VIN when input voltage range is from 2.5V to 5.5V, The AP3417C is available in SOT-23-5 and W-DFN2020-6 (Type US) packages.",
