          "vendor": "TEXAS INSTRUMENTS",
          "detailled_info": "The TPS6208x devices are a family of high frequency synchronous step down converters. With an input voltage range of 2.3 V to 6 V, common battery technologies are supported. Alternatively, the device can be used for low voltage system power rails. The TPS6208x focuses on high efficiency step-down conversion over a wide output current range. At medium to heavy loads, the converter operates in PWM mode and automatically enters Power Save Mode operation at light load currents to maintain high efficiency over the entire load current range. To maintain high efficiency at very low load or no load currents, a Snooze Mode with an ultra-low quiescent current is implemented. This function, enabled by the MODE pin, increases the run-time of battery driven applications and keeps the standby current at its lowest level to meet green energy standards targeting a low stand-by current.",
