          "detailled_info": "The TPS62560 device is a high efficiency synchronous step down converter, optimized for battery powered portable applications. It provides up to 600-mA output current from batteries, such as single Li-Ion or other common chemistry AA and AAA cells. With an input voltage range of 2.5 V to 5.5 V, the device is targeted to power a large variety of portable handheld equipment or POL applications. The TPS62560 family operates at 2.25-MHz fixed switching frequency and enters a Power Save Mode operation at light load currents to maintain a high efficiency over the entire load current range. The Power Save Mode is optimized for low output voltage ripple. For low noise applications, the device can be forced into fixed frequency PWM mode by pulling the MODE pin high. In the shutdown mode the current consumption is reduced to less than 1 uA. The TPS62560 allows the use of small inductors and capacitors to achieve a small solution size.",
