          "vendor": "TEXAS INSTRUMENTS",
          "detailled_info": "The TPS6222x devices are a family of high-efficiency, synchronous step-down converters ideally suited for portable systems powered by 1-cell Li-Ion or 3-cell NiMH/NiCd batteries. The devices are also suitable to operate from a standard 3.3-V or 5-V voltage rail. With an output voltage range of 6 V down to 0.7 V and up to 400-mA output current, the devices are ideal for powering the low voltage TMS320 DSP family and processors used in PDAs, pocket PCs, and smart phones. Under nominal load current, the devices operate with a fixed switching frequency of typically 1.25 MHz. At light load currents, the part enters the power-save mode operation; the switching frequency is reduced and the quiescent current is typically only 15 uA; therefore, the device achieves the highest efficiency over the entire load current range. The TPS6222x needs only three small external components. Together with the tiny TSOT23 package, a minimum system solution size can be achieved. An advanced fast response voltage mode control scheme achieves superior line and load regulation with small ceramic input and output capacitors.",
