          "detailled_info": "The MAX77596 is a small, synchronous buck converter with integrated switches. The device is designed to deliver up to 300mA with input voltages from 3.5V to 24V, while using only 1.1A quiescent current at no load (fixed-output version). Voltage quality can be monitored by observing the RESET signal. The device can operate near dropout by running at 98% duty cycle, making it ideal for battery-powered applications. The device offers fixed 3.3V and 5V output versions, as well as an adjustable version. The adjustable version allows the user to program the output voltage between 1V and 10V by using a resistor-divider. Frequency is fixed at 1.7MHz, which allows for small external components and reduced output ripple. The device offers both forced-PWM and skip modes of operation, with ultra-low quiescent current of 1.1A in skip mode.",
