          "vendor": "ON SEMICONDUCTOR",
          "detailled_info": "The NCV890100 is a fixed-frequency, monolithic, Buck switching regulator intended for Automotive, battery-connected applications that must operate with up to a 36 V input supply. The regulator is suitable for systems with low noise and small form factor requirements often encountered in automotive driver information systems. The NCV890100 is capable of converting the typical 4.5 V to 18 V automotive input voltage range to outputs as low as 3.3 V at a constant switching frequency above the sensitive AM band, eliminating the need for costly filters and EMI countermeasures. The NCV890100 also provides several protection features expected in Automotive power supply systems such as current limit, short circuit protection, and thermal shutdown. In addition, the high switching frequency produces low output voltage ripple even when using small inductor values and an all-ceramic output filter capacitor - forming a space-efficient switching regulator solution.",
