          "detailled_info": "The LTC3531/LTC3531-3.3/LTC3531-3 are synchronous buck-boost DC/DC converters that operate from input voltages above, below or equal to the output voltage. The topology incorporated in the ICs provides a continuous transfer through all operating modes, making the product ideal for single cell Li-Ion and multicell alkaline or nickel applications. The converters operate in Burst Mode, minimizing solution footprint and component count as well as providing high conversion efficiency over a wide range of load currents.",
