          "vendor": "TEXAS INSTRUMENTS",
          "detailled_info": "The TPS6305x family of devices is a high efficiency, low quiescent-current buck-boost converter, suitable for applications where the input voltage is higher or lower than the output. Continuous output current can go as high as 500 mA in boost mode and as high as 1 A in buck mode. The maximum average current in the switches is limited to a typical value of 1 A. The TPS6305x family of devices regulate the output voltage over the complete input voltage range by automatically switching between buck or boost mode depending on the input voltage, ensuring seamless transition between modes. The buck-boost converter is based on a fixed-frequency, pulse-width-modulation (PWM) controller using synchronous rectification to obtain the highest efficiency. At low load currents, the converter enters Power Save Mode to maintain high efficiency over the complete load current range.",
