          "vendor": "TOREX",
          "detailled_info": "The XC6371 series are a group of PWM controlled and PWM/PFM controlled step-up DC/DC converters. The built-in 1.4Ohm switching transistor type enables a step-up circuit to be configured using only three components, a coil, a diode, and a capacitor. Output voltage can be selectable in the range from 2.0V to 7.0V in increments of 0.1V (+-2.5%). Oscillation frequency is also selectable from 50kHz, 100kHz, and 180kHz (+-15%) for the XC6371 series. Soft-start time is internally set and offers protection against in-rush currents when the power is switched on and prevents voltage overshoot. 5 pin packages, which are provided with either a CE (chip enable) function that reduces quiescent current during shut-down mode, or a VDD pin (separated power and voltage detect pins) are available. The XC6371 series is the standard PWM controlled products.",
