          "vendor": "TEXAS INSTRUMENTS",
          "detailled_info": "The TPS61021A provides a power supply solution for portable or smart devices powered by alkaline, NiMH, Li-Mn, or Li-ion batteries. The TPS61021A is capable of outputting 3.3-V voltage and 1.5-A current from a battery discharged to as low as 1.8 V. Capable of operating with 0.5-V input voltage enables the TPS61021A to extend the battery run time. The TPS61021A operates at 2-MHz switching frequency at heavy load and enters power-save mode at light load to maintain high efficiency over the entire load current range. The device only consumes a 17-uA quiescent current from VOUT in light load condition. During shutdown, the load is completely disconnected from the input. In addition, The TPS61021A provides 4.35-V output overvoltage protection, output short circuit protection, and thermal shutdown protection. The TPS61021A offers a very small solution size due to low count of external components. It allows the use of small inductors and output capacitors with the 2-MHz switching frequency.",
