          "vendor": "TEXAS INSTRUMENTS",
          "detailled_info": "The TPS610994x is a synchronous boost converter with 1-uA ultra-low quiescent current. It is designed for products powered by an alkaline battery, NiMH rechargeable battery, Li-Mn battery or rechargeable Li-Ion battery, for which high efficiency under light load condition is critical to achieve long battery life operation. The TPS610994x boost converter uses a hysteretic control topology to obtain maximal efficiency at minimal quiescent current. It only consumes 1-uA quiescent current under light load condition and can achieve up to 75% efficiency at 10-uA load with fixed output voltage version. It can also support up to 300-mA output current from 3.3 V to 5 V conversion, and achieve up to 93% at 200-mA load. The TPS610994x also offers both Down Mode and Pass-Through operations for different applications. In Down Mode, the output voltage can still be regulated at target value even when input voltage is higher than output voltage. In Pass-Through Mode, the output voltage follows input voltage. The TPS610994x exits Down Mode and enters into Pass-Through Mode when Vin > Vout + 0.3 V.",
