          "vendor": "ON SEMICONDUCTOR",
          "detailled_info": "The NCP1406 is a monolithic step-up DC-DC converter operating in a Pulse Frequency Modulation (PFM) scheme with constant peak current control. It integrates a 0.8 A, 0.7  internal power switch and sensing resistor to monitor inductor current. This control scheme maintains high efficiencies over the entire load current range. The wide input voltage range, from 1.4V to 5.5 V, enables the user to operate the device from a Li-Ion battery or a two-cell Alkaline NiMH. Its ability to boost voltages up to 25 V, and to provide 1 W output power, makes the NCP1406 the perfect solution for biasing small and large OLED panels. This device also makes a perfect solution for biasing a great number of white LEDs in series. A Chip Enable pin allows the user to control the device to extend the battery life during standby, and can be pulse-width modulated for white LED applications. The versatility of the NCP1406 allows it to be configured not only as a step-up converter, but also as an inverter and as a step-down converter.",
