          "vendor": "ON SEMICONDUCTOR",
          "detailled_info": "The NCP1400A series are micropower step-up DC to DC converters that are specifically designed for powering portable equipment from one or two cell battery packs. These devices are designed to startup with a cell voltage of 0.8 V and operate down to less than 0.2 V. With only four external components, this series allows a simple means to implement highly efficient converters that are capable of up to 100 mA of output current. Each device consists of an on-chip fixed frequency oscillator, pulse width modulation controller, phase compensated error amplifier that ensures converter stability with discontinuous mode operation, soft-start, voltage reference, driver, and power MOSFET switch with current limit protection. Additionally, a chip enable feature is provided to power down the converter for extended battery life. The NCP1400A device series are available in the Thin SOT23-5 package with seven standard  regulated output voltages. Additional voltages that range from 1.8 V to 4.9 V in 100 mV steps can be manufactured.",
