          "detailled_info": "The SX1238 is a fully integrated ISM band transceiver optimized for use in the (FCC Part 15) 915 MHz band in the US and 868 MHz band in Europe with a minimum of external components. It offers a combination of high link budget and low current consumption in all operating modes.The 150 dB link budget is achieved by a low noise CMOS receiver front end and up to +27 dBm of transmit output power. This is made possible by a fully integrated front end consisting of a TR Switch, LNA and efficient PA. This makes SX1238 ideal for applications requiring extended range, high link budget, or operation in the presence of high interference.",
