          "vendor": "SEMTECH",
          "detailled_info": "The SX1272/73 transceivers feature the LoRa(TM) long range modem that provides ultra-long range spread spectrum communication and high interference immunity whilst minimising current consumption. Using Semtech's patented LoRa(TM) modulation technique SX1272/73 can achieve a sensitivity of over -137 dBm using a low cost crystal and bill of materials. The high sensitivity combined with the integrated +20dBm power amplifier yields industry leading link budget making it optimal for any application requiring range or robustness. LoRaTM also provides significant advantages in both blocking and selectivity over conventional modulation techniques, solving the traditional design compromise between range, interference immunity and energy consumption. These devices also support high performance (G)FSK modes for systems including WMBus, IEEE 802.15.4g. The SX1272/73 deliver exceptional phase noise, selectivity, receiver linearity and IIP3 for significantly lower current consumption than competing devices.",
