          "vendor": "ATMEL",
          "detailled_info": "The Atmel(R) ATA8520D is a highly integrated, low-power RF transceiver with an integrated AVR(R) microcontroller for applications using the wide area SIGFOX(TM) network The Atmel ATA8520D is partitioned into three sections: an RF front end, a digital baseband and the low-power 8-bit AVR microcontroller. The product is designed for the ISM frequency band in the range of 868.0MHz to 868.6MHz and 869.4 to 869.65MHz. The external part count is kept to a minimum due to the very high level of integration in this device. By combining outstanding RF performance with highly sophisticated baseband signal processing, robust wireless communication can be easily achieved. The transmit path uses a closed loop fractional-N modulator. The SPI interface enables external control and device configuration.",
