          "uuid": "de1b6991-f802-48ff-9451-8c4d603b1a31",
          "detailled_info": "The HMC545 and HMC545E are low-cost SPDT switches in 6-lead SOT26 plastic packages for use in general switching applications which require very low insertion loss and very small size. With 0.25dB typical loss, these devices can control signals from DC to 3.0 GHz and are especially suited for IF and RF applications including Cellular/3G, ISM, automotive and portables. The design provides exceptional insertion loss performance, ideal for filter and receiver switching. RF1 and RF2 are reflective shorts when \"Off\". The two control voltages require a minimal amount of DC current and offer compatibility with CMOS and some TTL logic families",
